description:
Rodrigo y Gabriela Live from Red Rocks with Colorado Symphony

Performed on July 28, 2013

Rodrigo y Gabriela, an internationally celebrated acoustic rock duo from Mexico, performs their unique blend of six-string metal, jazz and world music accompanied by the Colorado Symphony on stage at the Red Rocks Amphitheater in Morrison, Colorado.


